import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

const App = (props) => {
  return <h1>{props.counter}</h1>
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

